import "./styles.css";
import React, { useEffect, useState } from "react";
import MyComponent from "./component";
import GetPersonUserData from "./getperson";
import PostTimein from "./posttime";
import axios from 'axios';


export default function App() {

  const [data, setData] = useState([]);
  const [error, setError] = useState(null);

  useEffect(() => {
      axios.get('http://localhost:5000/personuppgifter/personnummer')
          .then((response) => {
              setData(response.data);
          })
          .catch((error) => {
              setError(error.message);
              console.error('There was an error!', error);
          });
  }, []);


  const [result, setResult] = useState(0);
  const [count, setCount] = useState("0");

  let buttonList = [];
  for (let i = 1; i < 10; i++) {
    buttonList.push(
      <button key={i} value={i} onClick={(e) => add(e)}>
        {i}
      </button>
    );
  }

  function reset() {
    setResult(0);
    setCount("0");
  }

  function add(e) {
    if (count === "0") {
      setCount(e.target.value);
    } else {
      setCount((curr) => curr + e.target.value);
    }
  }

  function CheckUserData() {

    const list = []

    for (var i = 0; i < data.length; i++) {
        const allpnummer = Object.values(data[i]);
        let onepnummer = JSON.parse(allpnummer);
        list.push(onepnummer)
  }

  for (var item in list) {
    if (list[item] == count) {
      const persondata = {
        value1: count,
        value2: '',
        value3: '',
    };
      console.log("CORRECT")
      //window.location.reload(true);
      axios.get('http://localhost:5000/personuppgifter/login', persondata)
      .then((response) => {
          console.log(response.data);
      })
      .catch((error) => {
          console.error('There was an error!', error);
      });
      const data = {
        value1: count,
        value2: count,
        value3: count,
    };
      axios.post('http://localhost:5000/', data)
      .then((response) => {
          console.log(response.data);
      })
      .catch((error) => {
          console.error('There was an error!', error);
      });
      break;
    }

    else {
      console.log("SORRY")
    }

}
  setCount("0");
}


var d = new Date();
var datestring = d.getFullYear() + "-" + (d.getMonth()+1)  + "-" + d.getDate()
var Today = new Date().toLocaleString()
let date = new Date();
let formattedDate = new Intl.DateTimeFormat('sv-SV').format(date);

  return (

    <div className="App">
        <div className="boxContainer">
        <h1 className="title">Lummelunda Grill</h1>
    <div className="Calculator">

      <div className="flex">
        <div className="counter">
          <h1>{count === "1" ? result : count}</h1>
        </div>
      </div>

      <div className="flex">
        <div className="buttons btn-style">
          {buttonList}
          <button onClick={reset}>X</button>
          <button value={0} onClick={(e) => add(e)}>
            0
          </button>
          <button onClick={CheckUserData}>In</button>
        </div>

      </div>

    </div>


    <div className="datablock">

<section>
  <h2>Personalliggare</h2>
  <h2>{formattedDate}</h2>
  <MyComponent />
</section>
        </div>

        </div>
        <footer>
        <p>
            Lummelunda Grill
        </p>
        <p>
            Orgnr
        </p>
      </footer>
    </div>
  );
}
